"""##What is loop control or Jump statements?
loop control statements are the statements which controls the execution of loops.

Types of loop control statements are :

* break

used to terminate the loop
* continue

used to escape from the present iteration
* pass

pass doesnt effect the code but it is used when you need to statement but not to execute that
"""

#using break statement
n=0
print("Output by using break statement :")
while(n<5):
    if n==3:
        break
    print(n)
    n+=1

#using continue and pass statement
n=0
print("Output by using continue statement :")
while(n<5):
    if n==3:
        n=n+1
        continue
    else:
        pass
    print(n)
    n=n+1



